prioridade na sua lista. Nossas conversas deixaram de ser profundas, e os assuntos delicados não foram mais tocados. Não que eu não quisesse falar sobre eles, era só que você preferia deixar tudo de baixo do tapete esperando que uma hora eles sumissem da minha mente. Mas eu nunca esquecia. Na verdade eu lembrava de tudo. Ainda lembro, pra ser sincero. E se quer saber, hoje eu percebo algo que antes o amor (ou a falta dele) não me deixava ver. Você me fazia mal. Todo aquele seu jeito de não lidar com as coisas, aquele afastamento, a conexão quebrada, toda a distância emocional... Eu sentia isso tudo na alma, e doía. Mas você nunca ligou, né? Argumentava dizendo que era seu jeito de amar, que foi ensinada assim. E na época eu tentava entender, as vezes até dialogava comigo mesmo, dizendo que estava tudo bem. O problema é que não estava nada bem. Não tem um jeito certo de se amar alguém, mas o seu era errado. Quem ama, cuida. E você não cuidava de mim. Pra você que está lendo isso agora, lembre-se do porquê de ter partido, não das lembranças boas de um amor meio bosta. O que é seu tá guardado. Então sinta alívio ao deixar ir quem não quer ficar. O amor da sua vida não é esse.

